import React from 'react'

function GetDataFromForm(props) {
  return (
    <div>
      <h1>{props.trip}</h1>
      <h1>{props.source}</h1>
      <h1>{props.destination}</h1>
      <h1>{props.child}</h1>
      <h1>{props.infant}</h1>
    </div>
  )
}

export default GetDataFromForm
